  const [links, SetLinks] = useState();

  useEffect(()=>{
    fetch('http://localhost:3001/data')
        .then(response => response.json())
        .then((data) => {
          SetLinks(data[0].lecture[1].link)
          console.log(data[0].lecture[1].link);
          
        })
  },[])

  return (
    
      <Document file={'/test.pdf'} >
        <Page pageNumber={1} ></Page>
        <Page pageNumber={2} ></Page>
        <Page pageNumber={3} ></Page>
        <Page pageNumber={4} ></Page>
        <Page pageNumber={5} ></Page>
      </Document>

  );
}
export default LectionPage;
